import Head from "next/head";
import Layout from "../components/layouts";

const Noop = ({ children }) => children;

export default function JustSell({ Component }) {
  return (
    <>
      <Head>
        <title>JustSell</title>
      </Head>

      <Layout>
        <Component />
      </Layout>
    </>
  );
}
